// Helper function to get specialty color
function getSpecialtyColor(specialty) {
    const specData = SAMD_DATA.specialties[specialty];
    return specData ? specData.color : SAMD_DATA.specialties["OTHER"].color;
}

// Helper function to get specialty label
function getSpecialtyLabel(specialty) {
    const specData = SAMD_DATA.specialties[specialty];
    return specData ? specData.label : specialty;
}

// Helper function to get initials from name
function getInitials(name) {
    const parts = name.replace(/^Dr\.?\s*/i, '').split(' ');
    if (parts.length >= 2) {
        return (parts[0][0] + parts[parts.length - 1][0]).toUpperCase();
    }
    return parts[0].substring(0, 2).toUpperCase();
}

// Export for use in other modules
if (typeof module !== 'undefined' && module.exports) {
    module.exports = { SAMD_DATA, getSpecialtyColor, getSpecialtyLabel, getInitials };
}
